import React from 'react';

class Head extends React.Component{
    render(){
        return(
        <head>
            <meta charset="UTF-8" />
            <link rel="stylesheet" href="../src/style.css" />
            <title>GitHub</title>
         </head>
        );
    }
}
export default Head;
